class MyLayout extends Component {
  constructor(props){
    super(props)
    console.log(props)
    this.state = {
        collapsed: false,
        username:'',
        submenu:['data'],
        items:[]
    };
    // this.onItems = this.onItems.bind(this)
    this.onCollapse = this.onCollapse.bind(this)
    this.onMenu = this.onMenu.bind(this)
    this.onOpenChange = this.onOpenChange.bind(this)
    this.getChildFn = this.getChildFn.bind(this)
  }
  // state = {
  //   collapsed: false,
  //   username:'',
  //   submenu:['data']
  // };
  onItems = async ()=>{
    const username = localStorage.getItem('name')
    console.log(username)
    if(username){
      console.log('1111')
      const menu = await getMenu()
      console.log(menu)
      const menus=menu['menu'].map(item => {
        if(item.children.length>0){
          return getItem(item.label,item.key,<AppstoreOutlined />,item.children)
        }else{
          return getItem(item.label,item.key,<AppstoreOutlined />)
        }
        
      })
      console.log(menus)
      this.setState({
        items:menus
      })
      
      
    }else{
      console.log('......')
      this.props.navigate(`/signin`,{replace:true})
    }
  }
  
 
  componentDidMount(){
    console.log('mount')
    if(this.props.href.pathname=='/'){
      this.onItems()
    }
    
  }
  
  onCollapse = (collapsed) => {
    console.log(collapsed);
    this.setState({
      collapsed,
    });
  };
  
  
  onMenu=({ item, key, keyPath, domEvent })=>{
    console.log(item,key,keyPath,domEvent)
    console.log(this)
    // navigate(`/${key}`, { replace: true })
    this.props.navigate(`/${key}`, { replace: true })
  }

  onOpenChange=(submenu)=>{
    console.log(submenu)
    this.setState({submenu})
  }
  
  getChildFn = (e) => {
    console.log(e);
    // this.setState({
    // //把子组件传递过来的值赋给this.state中的属性
    //   username: e
    // })
    this.onItems()
  }

  render() {
    
    const { collapsed,username,submenu ,items} = this.state;
    
    return (
      <Layout
        style={{
          minHeight: '100vh',
        }}
      >
        <Sider collapsible collapsed={collapsed} onCollapse={this.onCollapse}>
            {collapsed?
            <div className="logo">
                <Image
                   
                    src="./logo.png"
                    fallback="data:image/png;base64,"
                /></div>
            :<div className="logo">
                <Image
                    
                    src="./logo.png"
                    fallback="data:image/png;base64,"
                />
                LIMS</div>}
          
          <Menu theme="dark" defaultSelectedKeys={[this.props.href.pathname.slice(1)]}  defaultOpenKeys={submenu} openKeys={submenu} mode="inline" items={items} onClick={this.onMenu} onOpenChange={this.onOpenChange}/>
        </Sider>
        <Layout className="site-layout">
            <MyHeader getChild={this.getChildFn}></MyHeader>
          {/* <Header
            className="site-layout-background"
            style={{
              padding: '0 10px',
            }}
          >
              <Row>
                  <Col flex={3}></Col>
                  <Col flex={1}>
                    <Badge size="small" count={5}>
                      <BellOutlined />
                    </Badge>  
                  </Col>
                  <Col flex={1}>

                      {username?<p>欢迎您，{username}</p>:<Link to={{pathname:'/signin'}}><Button type='text' onClick={this.onSignin}>signin</Button></Link>}

                  </Col>
                  {username&&<Col flex={1}></Col>}
                  {now.getFullYear()+'-'+now.getMonth()+'-'+now.getDate()+' '+now.getHours()+':'+now.getMinutes()+':'+now.getSeconds()+' '+weeks[now.getDay()]}
              </Row>
          </Header> */}
          <Content
            style={{
              margin: '0 16px',
            }}
          >
            {/* <Breadcrumb
              style={{
                margin: '16px 0',
              }}
            >
              <Breadcrumb.Item>User</Breadcrumb.Item>
              <Breadcrumb.Item>Bill</Breadcrumb.Item>
            </Breadcrumb> */}
            <div
              className="site-layout-background"
              style={{
                padding: 24,
                minHeight: 360,
              }}
            >
              {/* <PathRoute /> */}
              {/* {this.props.children} */}
              {/* {withRouter (<PathRoute />)} */}
              {/* <Outlet/> */}
              {this.props.children}
            </div>
          </Content>
          <Footer
            style={{
              textAlign: 'center',
            }}
          >
            ©Yicon (Beijing) Biomedical Technology Inc.
          </Footer>
        </Layout>
      </Layout>
    );
  }
}
